print '-->Transaccion Autorizada: Producto-Moneda'
delete cobis..cl_pro_moneda 
where  pm_producto = 14
go

values (14,'R',0, 'PFI',getdate(),'V')
go

print '-->Transaccion Autorizada: Producto Instalado'
