where pi_producto = 'PFI'
go

values ('PFI','cob_pfijo',null,'sp_cons_total_operacion','S','sp_consulta_benef',14401,14637)
go

update cobis..cl_seqnos
set siguiente = (select max(pd_producto) from cobis..cl_producto)
where tabla = 'cl_producto'
go

print '-->Transaccion Autorizada: Transaccion'
delete cl_ttransaccion 
where tn_trn_code between 14000 and 14999
go


