print '-->Transaccion Autorizada: Procedimientos'
delete ad_procedure 
where pd_procedure between 14000 and 14999
go

go

print '-->Transaccion Autorizada: Procedimiento-Transaccion'
delete ad_pro_transaccion where pt_producto = 14
go

go

declare @w_moneda tinyint

select @w_moneda = em_moneda_base
from   cob_conta..cb_empresa
where  em_empresa = 1

select @w_moneda = isnull(@w_moneda,0)  --define codigo de la moneda local que se use en la instalacion--

update cobis..cl_pro_moneda
set    pm_moneda   = @w_moneda
where  pm_producto = 14
and    pm_moneda   = 0
go

